import { Link } from "react-router-dom";
import "../client.scss"

const ClientTag = (props) => {

    const {name, client} = props

    return (
        <div className="client-tag">
            <Link to={{
                pathname: '/client',
                state: {
                    client: client
                }
            }}>
            <h2>{name}</h2>
            </Link>
        </div>
    )
}

export default ClientTag
